import React from 'react';
import {useState} from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
	<div>
		<ul>
			<li>9 month</li>
			<li>10 month</li>
			<li>11 month</li>
			<li>12 month</li>
			<li>1</li>
			<li>2</li>
			<li>3</li>
		</ul>
	</div>
    </div>
  );
}

export default App;
